import React from 'react'
import { useSelector } from "react-redux"

function List() {
  const items = useSelector((state) => state.notes.items)
  return (
    <div>
      
      <ul>
        {items.map((item,i)=>
        <li key={i}>
          {item.textarea}
        </li>
        )}
      </ul>
    </div>
  )
}

export default List
